import React from 'react';
import axios from 'axios';

const PrisonOverview = props =>  {
    return (
        <div>
            {props.prisoners.map(prisoner => (
                <div>
                    <h3>{prisoner.name}</h3>
                    <p>{prisoner.skills}</p>
                    <p>{prisoner.availability}</p>
                </div>
            ))}
        </div>
    )
};

export default PrisonOverview;
